func countXmasEncounters(input [][]rune, i int, j int) int {
	return findXmas(input, i, j, 0, 1) +
		findXmas(input, i, j, 1, 1) +
		findXmas(input, i, j, 1, 0) +
		findXmas(input, i, j, 1, -1) +
		findXmas(input, i, j, 0, -1) +
		findXmas(input, i, j, -1, -1) +
		findXmas(input, i, j, -1, 0) +
		findXmas(input, i, j, -1, 1)
}

var xmas = []rune("XMAS")

func findXmas(input [][]rune, i, j int, di, dj int) int {
	for _, letter := range xmas {
		if i < 0 || j < 0 || i >= len(input) || j >= len(input[i]) {
			return 0
		}
		if input[i][j] != letter {
			return 0
		}
		i += di
		j += dj
	}
	return 1
}
